import React from "react";
import NewsItem from "./NewsItem";
import s from "./News.module.css";

const News = (props) => {
  return (
    <div className={s.news}>
      {props.games
        .filter((n) => n.news)
        .map((game) => {
          return <NewsItem game={game} />;
        })}
      <NewsItem
        gameName={"Path of Exile"}
        text={"New league Expedition is coming! Release on Jul 23!"}
        foto={"https://www.pdvg.it/wp-content/uploads/2021/07/KeyArt-1.jpg"}
      />
      <NewsItem
        gameName={"Fortnite"}
        text={
          "Rebuilt and ready for action. When things get tough, get tougher."
        }
        foto={
          "https://cdn2.unrealengine.com/17br-armoredbatman-1920x1080-1920x1080-204612458d51.jpg?h=720&resize=1&w=1280"
        }
      />
    </div>
  );
};

export default News;
